import React, { useRef, useState } from 'react';
import { Canvas, useFrame } from '@react-three/fiber';
import { OrbitControls, PerspectiveCamera } from '@react-three/drei';
import * as THREE from 'three';

function CoffeeCup() {
  const meshRef = useRef();

  useFrame((state) => {
    if (meshRef.current) {
      meshRef.current.rotation.y = Math.sin(state.clock.elapsedTime * 0.5) * 0.1;
    }
  });

  return (
    <group ref={meshRef}>
      {/* Cup Body */}
      <mesh position={[0, 0, 0]} castShadow receiveShadow>
        <cylinderGeometry args={[0.8, 0.6, 1.2, 32]} />
        <meshPhongMaterial color="#8B4513" />
      </mesh>

      {/* Coffee Liquid */}
      <mesh position={[0, 0.3, 0]}>
        <cylinderGeometry args={[0.75, 0.55, 0.8, 32]} />
        <meshPhongMaterial color="#3E2723" />
      </mesh>

      {/* Handle */}
      <mesh position={[1, 0, 0]} castShadow>
        <torusGeometry args={[0.3, 0.1, 8, 16, Math.PI]} />
        <meshPhongMaterial color="#8B4513" />
      </mesh>

      {/* Rim */}
      <mesh position={[0, 0.6, 0]}>
        <torusGeometry args={[0.8, 0.05, 16, 32]} />
        <meshPhongMaterial color="#A0522D" />
      </mesh>
    </group>
  );
}

function SteamParticle({ position }) {
  const meshRef = useRef();
  const [opacity, setOpacity] = useState(1);

  useFrame((state) => {
    if (meshRef.current) {
      meshRef.current.position.y += 0.02;
      meshRef.current.position.x += Math.sin(state.clock.elapsedTime * 2 + position) * 0.01;
      setOpacity(Math.max(0, opacity - 0.01));

      if (meshRef.current.position.y > 2) {
        meshRef.current.position.y = 0.6;
        setOpacity(1);
      }
    }
  });

  return (
    <mesh ref={meshRef} position={[position * 0.2, 0.6, 0]}>
      <sphereGeometry args={[0.05, 8, 8]} />
      <meshBasicMaterial color="#FFFFFF" transparent opacity={opacity} />
    </mesh>
  );
}

function Steam() {
  return (
    <group>
      {[0, 1, 2, 3, 4].map((i) => (
        <SteamParticle key={i} position={i} />
      ))}
    </group>
  );
}

export default function CoffeeScene() {
  return (
    <div className="w-full h-96 md:h-[500px]">
      <Canvas shadows>
        <PerspectiveCamera makeDefault position={[0, 2, 5]} />
        <OrbitControls 
          enableZoom={false} 
          enablePan={false}
          maxPolarAngle={Math.PI / 2}
          minPolarAngle={Math.PI / 4}
        />

        {/* Lighting */}
        <ambientLight intensity={0.4} />
        <directionalLight 
          position={[5, 5, 5]} 
          intensity={0.8} 
          castShadow
          shadow-mapSize-width={2048}
          shadow-mapSize-height={2048}
        />
        <pointLight position={[-5, 3, 0]} intensity={0.3} color="#D4AF37" />

        {/* Coffee Cup */}
        <CoffeeCup />

        {/* Steam Effect */}
        <Steam />

        {/* Table Surface */}
        <mesh position={[0, -0.6, 0]} receiveShadow>
          <cylinderGeometry args={[3, 3, 0.2, 32]} />
          <meshPhongMaterial color="#654321" />
        </mesh>
      </Canvas>
    </div>
  );
}
